const fetchAPI = {
  fetchItems: async () => {
    console.log("fetchAPi");
    const response = await fetch("http://127.0.0.1:4000/items", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        authorization: token,
      },
    });
    return response;
  },
};
export default fetchAPI;
